import "../components/Timeline.css";

function Timeline() {
  <div>
    <section class="intro-text">
      <div class="container">
        <h1>Tutorial Timeline</h1>
        <p>A timeline of my accomplishments.</p>
      </div>
    </section>
  </div>;
}

export default Timeline;
